import react from 'react'
import emailjs from 'emailjs-com'

import img1 from '../img/contactinfo.svg'

import discord from '../img/discord.svg'
import gmail from '../img/gmail.svg'
import facebook from '../img//facebook.svg'



const Form =()=>{
    const SendMail =(e)=>{
      e.preventDefault();

if(e.target.nombre.value.length > 3  && e.target.apellido.value.length > 3 && e.target.correo.value.length > 3){
  emailjs.sendForm('service_thn34om', 'template_i2fjxsl', e.target, 'user_Tm5AttXYzU5BuRTJWijHT')
      .then((result) => {
          console.log(result.text);
      }, (error) => {
          console.log(error.text);
      });
      e.target.reset()
  
}else{
  return(
    <h1>Informacion Incorrecta</h1>
  )
}
       
    }
    return(
       <div>
             <div class="containerform" >
    <div>

      <form  method="POST" id="contact" onSubmit={SendMail}>
      <span>
          <p>Nombre</p>
          <input type="text" placeholder="Juan Carlos" name="nombre" className="nombre"/>
        </span>



        <span>
          <p>Apellidos</p>
          <input type="text" placeholder="Ramirez" name="apellido" className="apellido"/>
        </span>

        <span>
          <p>Correo</p>
          <input type="text" placeholder="Nestormyriee@gmail.com" name="correo" className="correo"/>
        </span>
        <span>
          <p>Numero</p>
          <input type="text"   name="numero" className="numero"/>
        </span>

        <span className="mensajecontent">
          <p>Mensaje</p>
          <textarea  className='mensaje'name="mensaje"  placeholder="Cuentame Tu priyecto"></textarea>
        </span>
        <input type='submit' value="Enviar" className="enviar" />
      </form>
    </div>
    <div>
      <img src={img1} alt=""/>
      <div class="anclas">
        <img src={discord} alt=""/>
        <img src={gmail} alt=""/>
        <img src={facebook} alt=""/>
      </div>
    </div>
   
  </div>
       </div>
    )
}
export default Form
